MathJax.Localization.addTranslation("ca","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax est\xE0 utilitzant fonts basades en web per mostrar les expressions matem\xE0tiques d'aquesta p\xE0gina. Aix\xF2 porta un temps per descarregar, de tal manera que la p\xE0gina es mostrar\xE0 m\xE9s r\xE0pidament si instal\xB7leu les fonts matem\xE0tiques directament a la vostra carpeta de sistema de fonts.",imageFonts:"MathJaz est\xE0 utilitzant les seves fonts d'imatge en comptes de fonts locals o basades en web. Aix\xF2 pot fer que la composici\xF3 de la p\xE0gina sigui m\xE9s lenta que l'habitual, i les expressions matem\xE0tiques poden no imprimir-se a resoluci\xF3 completa en la vostra impressora.",noFonts:"MathJax no pot localitzar una font per a utilitzar-la a l'hora de mostrar les expressions matem\xE0tiques, de tal manera que es recolza en car\xE0cters Unicode gen\xE8rics, amb el sup\xF2sit que el vostre navegador ser\xE0 capa\xE7 de mostrar-les. Alguns car\xE0cters poden no mostrar-se correctament, o fins i tot poden no mostrar-se en absolut.",webFonts:"La majoria de navegadors moderns permeten la desc\xE0rrega de les fonts. Si actualitzeu a una versi\xF3 m\xE9s nova del vostre navegador (o si canvieu de navegador) podreu millorar la qualitat de les expressions matem\xE0tiques d'aquesta p\xE0gina.",fonts:"MathJax pot utilitzar tant les [fonts STIX](%1) com les [fonts TeX MathJax](%2). Descarregueu i instal\xB7leu una d'aquestes fonts per millorar la vostra experi\xE8ncia MathJax.",STIXPage:"Aquesta p\xE0gina est\xE0 dissenyada per usar les [fonts STIX](%1). Descarregueu i instal\xB7leu aquestes fonts per millorar la vostra experi\xE8ncia MathJax.",TeXPage:"Aquesta p\xE0gina est\xE0 dissenyada per usar les [fonts TeX MathJax](%1). Descarregueu i instal\xB7leu aquestes fonts per millorar la vostra experi\xE8ncia MathJax."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/ca/FontWarnings.js");
